class Navigation extends React.Component{
    render(){
        return(
            <div>
                <nav className="navbar">
                    <ul>
                        <li className ="nav-item">
                            <a className ="nav-link" href="link_1">MENU</a>
                        </li>
                        
                    </ul>

                </nav>
            </div>
        )
    }
}
export default Navigation
